import React from 'react';

const DropDown = ({ options }) => {
  const reneredOptions = options.map((option) => {
    return (
      <div key={option.value} className="item">
        {option.label}
      </div>
    );
  });
  return <div>{reneredOptions}</div>;
};

export default DropDown;
